import React from "react";
import { FooterLinks, Icons } from "./Constants";
import FooterListWrapper from "./FooterWrapper";
import {
  Container,
  FooterBlock,
  FooterContent,
  FooterDivider
} from "./FooterFragments";

const Footer = () => (
  <Container>
    <FooterBlock>
      <FooterContent>
        {FooterLinks.map(
          (item, index) =>
            !item.lowerFooter && <FooterListWrapper key={index} item={item} />
        )}
        {Icons.map(
          (item, index) =>
            !item.lowerFooter && <FooterListWrapper key={index} item={item} />
        )}
      </FooterContent>
    </FooterBlock>
    <FooterDivider />
    <FooterBlock>
      <FooterContent>
        {FooterLinks.map(
          (item, index) =>
            item.lowerFooter && <FooterListWrapper key={index} item={item} />
        )}
        {Icons.map(
          (item, index) =>
            item.lowerFooter && <FooterListWrapper key={index} item={item} />
        )}
      </FooterContent>
    </FooterBlock>
  </Container>
);

export default Footer;
